#region # embeded binaries (  Base64 strings ) reference: https://trevorsullivan.net/2012/07/24/powershell-embed-binary-data-in-your-script/
# sqllite dll file
$Dll_Name = "System.Data.SQLite.dll"
$Dll_Path = "{0}\{1}" -F $PSScriptRoot, $Dll_Name
$Dll_Content = '';
# Powershell CmdLets for managing SQLlist
$CmdLet_Name = "sqllite_cmdlet.ps1"
$CmdLet_Path = "{0}\{1}" -F $PSScriptRoot, $CmdLet_Name
$CmdLet_Content = 
''
#endregion
#region # function to extract binary from BASE 64  variable
function Convert-StringToBinary {
    [CmdletBinding()]
    param ( [string] $InputString, 
    [string]$FilePath = ('{0}\{1}' -f $env:TEMP, [System.Guid]::NewGuid().ToString()) )
    
    try {
        if ($InputString.Length -ge 1) {
            $ByteArray = [System.Convert]::FromBase64String($InputString);
            [System.IO.File]::WriteAllBytes($FilePath, $ByteArray);
        }
    }
        
    catch {
        throw (Failed to create file from Base64 string: {0} -f $FilePath);
    }
    
    if ( ( Test-Path -path $FilePath  ) -eq $false ) {
        New-Item -Name $FilePath -ItemType File
    }
        
        
    Write-Output -InputObject (Get-Item -Path $FilePath);
}
#endregion
#region # process sqllite dll restoration
if ( ( Test-Path -Path $Dll_Path) -eq $false ) { Convert-StringToBinary -InputString $Dll_Content -FilePath $Dll_Path }
# load dll to current powershell session
if ( -not ($Library = Add-Type -path $Dll_Path -PassThru -ErrorAction stop) ) { Throw "This module requires the ADO.NET driver for SQLite:`n`thttp://system.data.sqlite.org/index.html/doc/trunk/www/downloads.wiki" }
#endregion
#region # process ps1  file restoration
if ( ( Test-Path -Path $CmdLet_Path) -eq $false ) { Convert-StringToBinary -InputString $CmdLet_Content -FilePath $CmdLet_Path }
# load powershell script
if (-not(Get-Command 'Invoke-SqliteQuery' -errorAction SilentlyContinue)) { . $CmdLet_Path }
#endregion

#region # actual script start